import React from 'react'
import Link from 'next/link'

import Attraction from '../components/Attraction'



type attr ={
        id: number,
        location_lng: number,
        location_lat: number,
        opening_hours: number[],
        created: string,
        source: string,
        name: string,
        address: string,
        rating: number,
        number_of_reviews: number,
        about: number,
             tags: string[],
        main_photo_url:string
        order_page: any,
        is_free: boolean,
        price: any
}

const indexPage = () => {     
        const json : attr[]= require('../data/attractions_museums_tlv.json')   
        return (
                
                <div>
                        <h1>Hello Bridgify!! :)</h1>
                        <p>go to <Link href="/auth"><a>Auth</a></Link></p>
                        <Attraction name="My Trip" city="Tel Aviv" rating={4.4} />
                <ul>
                {json.map(attr => <li key={attr.id}>{attr.name},{attr.number_of_reviews} - {attr.rating}</li>)}
              </ul>
                </div>
        )
}


export default indexPage

//  1. Create an index web page which contains a designed list of attractions
// a.import JSON file
// b. map it into components
// c. design the components
